// App.js
import Navbar from './components/Navbar';
import Sidebar from './components/Sidebar';
import ImageAudioSection from './components/ImageAudioSection';
import StatusSection from './components/StatusSection';
import Footer from './components/Footer';

function App() {
  return (
    <div className="min-h-screen bg-gray-100 font-sans flex flex-col justify-between">
      <Navbar />
      <main className="flex-grow">
        <div className="max-w-screen-xl mx-auto grid grid-cols-12 gap-4 p-4">
          <div className="col-span-2">
            <Sidebar />
          </div>
          <div className="col-span-10">
            <ImageAudioSection />
            <StatusSection />
          </div>
        </div>
      </main>
      <Footer />
    </div>
  );
}

export default App;
